import React from 'react';
import NavBar from '../components/NavBar'; // Fixed the casing issue
import { Link } from 'react-router-dom';

function SearchBook() {
	return (
		<div>
			<NavBar />
			<h1 className="text-3xl font-bold mb-4">SearchBook Page</h1>
			<Link to="/BookInfo">
				<button>Go to book info</button>
			</Link>
			
		</div>
	);
}

export default SearchBook;
